    for(let j=0;j<3;j++)t.push(' ')
    t1.push(t);
}

}
temp(b);
export default class TicTac extends React.Component{
    render(){
        return(
            <div className='Tictac'>
                {b.map((arr,index)=><Ticrow arr={arr} r={index}/>)}
            </div>
        )
    }
}
class Ticrow extends React.Component{
    render(){
        return(
            <div className='ticrow'>
                {this.props.arr.map((ele,index)=><Ticelement r={this.props.r} c={index}/>)}
            </div>
        )
    }
}
class Ticelement extends React.Component{
    render(){
        return(
            <div className='Ticelement'>
                {b[this.props.r][this.props.c]}
            </div>
        )
    }
}
